import React from 'react';
import { Link } from 'react-router-dom';

{threads.map(t => (
  <Link to={`/forum/${t._id}`} key={t._id}>
    <ForumThread
      title={t.title}
      author={t.author}
      replies={t.replies.length}
      createdAt={t.createdAt}
    />
  </Link>
))}


const Navbar = () => {
  return (
    <nav className="bg-white shadow-md px-6 py-4 flex justify-between items-center">
      <Link to="/" className="text-xl font-bold text-blue-600">TravelConnect ðŸšŒ</Link>
      <div className="space-x-4">
        <Link to="/" className="text-gray-700 hover:text-blue-600">Home</Link>
        <Link to="/submit" className="text-gray-700 hover:text-blue-600">Share Story</Link>
        <Link to="/forum" className="text-gray-700 hover:text-blue-600">Forum</Link>
      </div>
    </nav>
  );
};

export default Navbar;
